public class SpotifyMusicPlayer {
    Player mPlayer;

    public SpotifyMusicPlayer(Config config, final Object reference){
        Spotify.getPlayer(config, reference, new SpotifyPlayer.InitializationObserver() {
           @Override
           public void onInitialized(SpotifyPlayer spotifyPlayer) {
               mPlayer = spotifyPlayer;
               mPlayer.addConnectionStateCallback((ConnectionStateCallback) reference);
               mPlayer.addNotificationCallback((Player.NotificationCallback) reference);
           }

           @Override
           public void onError(Throwable throwable) {
               Log.e("MainActivity", "Could not initialize player: " + throwable.getMessage());
           }
       });

    }

    // For testing purposes, its playing the same track and not using the track id.
