namespace express
{
    class treeses
    {
        double val;
        treeses left, right;
        string op;
        double x;
        public treeses(treeses e, treeses f, double n)
        {
            left = e;
            right = f;
            val = n;
        }

        public treeses(treeses e, treeses f, string n)
        {
            left = e;
            right = f;
            op = n;
        }

        public treeses() { }

        public treeses makeTree(string ONP)
        {
            treeses e;
            var nodes = new Stack<treeses>();
            var variable = ONP.Split(new[] { ' ' }, StringSplitOptions.RemoveEmptyEntries);
            for(int i=0; i<variable.Length;i++)
            {
                e = new treeses();
                
                e.left = e.right = null;
                if (IsOp(variable[i]) == true)
                {
                    var rightt = nodes.Pop();
                    var leftt = nodes.Pop();
                    nodes.Push(new treeses(leftt, rightt, variable[i]));
                }
                else
                {
                    e.val = Convert.ToDouble(variable[i]);
                    e.op = "00";
                    nodes.Push(e);
                }
            }
            System.Diagnostics.Debug.Assert(nodes.Count == 1);
            treeses tree = nodes.Pop();
            return tree;
        }

        public double eval(treeses e)
        {
           
            if (e.op == "00")
            {
                x = e.val;
                return x;
            }
            else
            {
                switch (e.op)
                {
                    case "+": return x = eval(e.left) + eval(e.right);
                    case "-": return x = eval(e.left) - eval(e.right);
                    case "*": return x = eval(e.left) * eval(e.right);
                    case ":":
                    case "/":
                        {
                            if (eval(e.right) != 0)
                                return x =  (eval(e.left) / eval(e.right));
                            else
                                MessageBox.Show("Cos zle!");
                            break;
                        }
                }
            }
            return x;
        }

        public bool IsOp(string c)
        {
            if (c == "+" || c == "-" || c == "*" || c == "/" || c == "^")
            {
                return true;
            }
            else
                return false;
        }
    }
}

